import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for products to load using multiple selector strategies
    await page.waitForSelector('.product-card, .products-grid, .product-price', { timeout: 15000 });

    // Extract all product prices using multiple selector approaches
    const prices = await page.$$eval('.product-price', priceElements => 
      priceElements.map(el => {
        // Extract just the current price (ignore original price if present)
        const priceText = el.textContent.trim();
        // Match the first price pattern (current price)
        const priceMatch = priceText.match(/\$\d+\.\d{2}/);
        return priceMatch ? priceMatch[0] : priceText;
      })
    );

    // Take screenshot after extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_prices_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_prices_extracted.png'));

    return {
      success: true,
      action: "Extracted all product prices from the Amazon simulation page",
      extractedData: {
        prices: prices,
        count: prices.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to extract product prices",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
